import React from 'react';
import './slider.css';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper-bundle.css';
import image01 from '../../../assets/img/common/NE@3x.png';

const Imageslider = () => {
  return (
    <Swiper 
    style={{padding:" 40px 0px 0px 70px"}}
    spaceBetween={-210}
    slidesPerView={4}
    onSlideChange={() => console.log('slide change')}
    onSwiper={(swiper) => console.log(swiper)}
      breakpoints={{
        320: {
            slidesPerView: 1,
            width: 200,
            spaceBetween: 95,
        },
        425: {
            slidesPerView: 1,
            width: 300,
            spaceBetween: 2,
        },
        500: {
            slidesPerView: 2,
            width: 570,
            spaceBetween: 20,
        },
        768: {
            slidesPerView: 3,
            width: 900,
            spaceBetween: -20,
        },
        1024: {
            slidesPerView: 3,
            width: 900,
            spaceBetween: 20,
        },
        1200: {
          slidesPerView: 3,
          width: 900,
          spaceBetween: 20,
      },
      1500: {
        slidesPerView: 3,
        width: 900,
        spaceBetween: 20,
    }}}
      
    >
      <SwiperSlide>
        <img src={image01} alt="Image 1" />
      </SwiperSlide>
      <SwiperSlide>
        <img src={image01} alt="Image 2" />
      </SwiperSlide>
      <SwiperSlide>
        <img src={image01} alt="Image 3" style={{ maxWidth: "501px", maxHeight: "443px"}} />
      </SwiperSlide>
      <SwiperSlide>
        <img src={image01} alt="Image 4" style={{ maxWidth: "501px", maxHeight: "443px"}} />
      </SwiperSlide>
      <SwiperSlide>
        <img src={image01} alt="Image 1" style={{ maxWidth: "501px", maxHeight: "443px"}} />
      </SwiperSlide>
      <SwiperSlide>
        <img src={image01} alt="Image 2" style={{ maxWidth: "501px", maxHeight: "443px"}} />
      </SwiperSlide>
      <SwiperSlide>
        <img src={image01} alt="Image 3" style={{ maxWidth: "501px", maxHeight: "443px"}} />
      </SwiperSlide>
      <SwiperSlide>
        <img src={image01} alt="Image 4" style={{ maxWidth: "501px", maxHeight: "443px"}} />
      </SwiperSlide>
     
    </Swiper>
  );
};

export default Imageslider;
